import React from 'react';
import '../../App.css';

export default function SignUp(){
    return (
        <div className='sign-up'>
            <img src ='/images/matterhorn.jpg' alt='signup' position="center" size="cover" repeat="no-repeat"/>        
            <h1 className='sign-up'>SIGN UP</h1>
        </div>
        );
    }
